import React from 'react';
import { NavLink } from 'react-router-dom';


const Navbar = () => {
    return (
        
        <div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-light-green border-bottom shadow-sm ">
            <h5 className="my-0 mr-md-auto font-weight-normal">Prothom Alo</h5>
            <nav className="my-2 my-md-0 mr-md-3">                
                <NavLink
                    to="/"
                    className="p-2 text-dark"
                >
                    Home
                </NavLink>
                <NavLink
                    to="/favourite"
                    className="p-2 text-dark"
                >
                    Favourite
                </NavLink>
            </nav>
        </div>

        
    );
};
 
export default Navbar;
